import styled from "styled-components";

const map = new Map();
const Tomato = styled.li`
  background-color: rgba(227, 26, 0, 1);
`;
map["tomato"] = `<Tomato>TEST </Tomato>`;
const Circle = styled.div`
  width: 5rem;
  height: 5rem;
  background: ${(props) => props.color || "black"};
  border-radius: 50%;
`;

export const IngredientList = (ingredienName) => {
  console.log("INGR: ", ingredienName);
  console.log(map.size);
  console.log(map.has(ingredienName));
  return map(ingredienName);
  //   return map[ingredienName];
};
